    constructor(props){
        super(props);
        this.state ={
            userName:''
        }
    }
    render(){
        return(
            <div>
                <label>Git User:</label>
                <br/>
                <input type="text" placeholder='user' value={this.state.userName} onChange ={ e => this.setState({userName:e.target.value})}/>
                <button>Find</button>
            </div>
        )
    }
}
